import * as C from './styles'

const ResumeItem = ({title, Icon} ) => {
  return (
    <C.Container>
        <C.Header>
            <C.HeaderTitle>
                {title}
            </C.HeaderTitle>
            <Icon />
        </C.Header>
        <C.Total>100</C.Total>
    </C.Container>
  )
}

export default ResumeItem
